import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { bookDataFetch } from "../redux/actions";

export const BookStore = () => {
	const booksData = useSelector((store) => store.data);
	const dispatch = useDispatch();
	const [filterData, setFilterData] = useState(booksData);

	useEffect(() => {
		dispatch(bookDataFetch());
	}, [dispatch]);

	return loading ? (
		<h2>Loadinig...</h2>
	) : (
		<>
			{filterData.map((e) => {
				return <p>{e.name}</p>;
			})}
		</>
	);
};
